import './App.css';
import { Route, Routes } from "react-router-dom"
import Login from './pages/Login/Login';
function App() {
  return (
    <div className="App">
      <Routes>
        <Route exact path="/login" element={<Login />}></Route>
      </Routes>
    </div>
  );
}

export default App;
